class ScaleableWaveData  {
    constructor(datain,mass=65,dist=420){
        this.t=datain.map(function(value,index){
            return value[0] - dataExtent[0] 
        })
        this.h=datain.map(function(value,index){
            return value[1];
        })
        this.linedata();
        this.t0=0.423;
        this.M0=65;
        this.D0=420;
        this.mass=(mass)?mass:65;
        this.dist=(dist)?dist:420;
        this.scale(mass,dist);        
    }    

    scale(m,d,tout){
        this.mass=m;
        this.dist=d;
        if (!tout){
            tout=this.t;
        }
        var dout=[];
        for (var i=0;i<tout.length;i++){
            let tScale=(tout[i]-this.t0)*this.M0/m + this.t0;
            let hout=this.getH(tScale)*(m/this.M0)*(this.D0/d);
            if (!Number.isNaN(hout)){dout.push([tout[i],hout]);}
        }
        return(new WaveData(dout));
    }
    
    linedata(){
        this.lineData=[];
        for (var i=0;i<this.t.length;i++){
            this.lineData.push({'t':this.t[i],'h':this.h[i]})
        }
        this.tint=d3.scaleLinear().range([0,this.t.length])
        this.tint.domain([this.t[0],this.t.slice(-1)])
    }
    getH(t){
        if (Array.isArray(t)){
            var h0=[];
            for (var i=0;i<t.length;i++){
                h0.push(this.getH(t[i]));
            }
        }else{
            var idx=this.tint(t);
            var h0;
            if (idx<0){
                h0=NaN;
            }else if(idx>this.t.length-1){
                h0=0;
            }else{
                let i0=Math.floor(idx), i1=Math.ceil(idx),di=idx%1;
                var h0=(1-di)*this.h[i0] + di*this.h[i1];
            };
        }
        return h0;
    }
    shiftt(t0){
        for (let i=0;i<this.t.length;i++){
            this.t[i]+=t0;
        }
        this.linedata();
    }    
}

function WaveFitter(params){
    var _wf=this;
    this.simNR = params.simNR?params.simNR:null;
    this.initData();
    this.holders={
        'param':((params.paramholder)?params.paramholder:'param-holder'),
        'graph':((params.graphholder)?params.graphholder:'graph-holder')
    }
    this.addSliders();
    this.toLoad=2;
    this.loaded=0;
    window.addEventListener("resize",function(){
        _wf.initGraph();
    });
    this.initGraph();
    return this;
}

WaveFitter.prototype.setDistance = function(distance) {
    this.dist = distance;
    this.updatePlot();
}
WaveFitter.prototype.setMass = function(mass) {
    this.mass = mass;
    this.updatePlot();
}

